import React /*, { Component, useState, useEffect}*/ from 'react';
import {Box, BoxExtendedProps} from 'grommet';

export const AppBar = () => (
	<Box
	  tag='header'
	  direction='row'
	  align='center'
	  justify='between'
	  background='white'
	  pad={{ left: 'medium', right: 'small', vertical: 'small' }}
	  elevation='medium'
	  style={{ zIndex: '1' }}
	  {...props}
	/>
  );
